import React, { Component } from "react";

// import { Link } from "react-router-dom";

class Landing extends Component {
  render() {
    return (
      <div className="container-fluid">
        <div className="row">
        <Container>
    <Row>
    <Col sm={8}>sm=8</Col>
    <Col sm={4}>sm=4</Col>
     </Row>
      <Row>
    <Col sm>sm=true</Col>
    <Col sm>sm=true</Col>
    <Col sm>sm=true</Col>
  </Row>
      </Container>
        </div>
      </div>
    );
  }
}

export default Landing;
